import React, { useState } from 'react'

function NavItem(props) {
  return(
    <li><a href="#" className="nav-item">{props.title}</a></li>
  )
}


export let NavBar = (props) => {

  const [toggleMenu, setToggleMenu] = useState(false)

  return(
      <nav className="mx-auto pl-auto bg-blue-900">
        <div>
          <button>Hello</button>
        </div>
        <div className="flex justify-center pt-3">
          <ul className='flex p-2'>
              <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-linear duration-75" href="#">Home</a></li>
              <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-linear duration-75" href="#">Projects</a></li>
              <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-linear duration-75" href="#">About</a></li>
              <li className='px-2 pb-1 text-white'><a className="pb-2 px-2 hover:border-b-4 border-white ease-linear duration-75" href="#">Contact</a></li>
            </ul>
        </div>
      </nav>
  )
}
